def ceb_bias_profile(x: float, y: float, sentiment: float) -> dict:
    return {
        "x": max(-1.0, min(1.0, x)),
        "y": max(-1.0, min(1.0, y)),
        "sentiment": max(-1.0, min(1.0, sentiment)),
    }


def ceb_bias_distance(a: dict, b: dict) -> float:
    dx = a["x"] - b["x"]
    dy = a["y"] - b["y"]
    ds = a["sentiment"] - b["sentiment"]
    return math.sqrt(dx * dx + dy * dy + ds * ds)


def ceb_bias_mix_score(a: dict, b: dict) -> float:
    dist = ceb_bias_distance(a, b)
    return max(0.0, min(1.0, 1.0 - dist / 1.7320508075688772))


def ceb_bias_orb_pin(x: float, y: float, sentiment: float, freq: float) -> dict:
    return {
        "bias": ceb_bias_profile(x, y, sentiment),
        "frequency": max(0.0, min(1.0, freq)),
    }


def ceb_bias_tune_colors(colors: list, pin: dict) -> list:
    bias = pin.get("bias", ceb_bias_profile(0.0, 0.0, 0.0))
    freq = pin.get("frequency", 1.0)
    tuned = []
    for color in colors:
        rgb = color.get("rgb", (0, 0, 0))
        cx = ((rgb[0] - rgb[2]) / 255.0)
        cy = ((rgb[1] - 128.0) / 128.0)
        cs = float(color.get("sentiment", 0.0))
        cprof = ceb_bias_profile(cx, cy, cs)
        mix = ceb_bias_mix_score(bias, cprof)
        weight = color.get("weight", 1.0) * (0.3 + 0.7 * mix) * freq
        tuned.append({"rgb": rgb, "weight": weight, "mix": mix})
    return tuned


def ceb_bias_filter_posts(posts: list, pin: dict) -> list:
    bias = pin.get("bias", ceb_bias_profile(0.0, 0.0, 0.0))
    freq = pin.get("frequency", 1.0)
    out = []
    for post in posts:
        rgb = post.get("rgb", (0, 0, 0))
        px = ((rgb[0] - rgb[2]) / 255.0)
        py = ((rgb[1] - 128.0) / 128.0)
        ps = float(post.get("sentiment", 0.0))
        pprof = ceb_bias_profile(px, py, ps)
        mix = ceb_bias_mix_score(bias, pprof)
        if bias["x"] <= -0.8 and bias["y"] <= -0.8 and px < 0.0:
            continue
        if mix * freq < 0.15:
            continue
        out.append({"post": post, "mix": mix})
    return out


def ceb_bias_engraph(prompt: str, pin: dict) -> dict:
    bias = pin.get("bias", ceb_bias_profile(0.0, 0.0, 0.0))
    freq = pin.get("frequency", 1.0)
    tokens = prompt.split()
    seed = sum(len(t) for t in tokens) % 997
    flow = []
    for i, t in enumerate(tokens[:512]):
        x = ((i + seed) % 37) / 18.0 - 1.0
        y = ((i * 3 + seed) % 41) / 20.0 - 1.0
        s = ((i * 5 + seed) % 3) - 1
        node = {
            "t": t,
            "bias": ceb_bias_profile(x, y, float(s)),
            "mix": ceb_bias_mix_score(bias, ceb_bias_profile(x, y, float(s))) * freq,
        }
        flow.append(node)
    return {"bias": bias, "frequency": freq, "nodes": flow}



def ceb_orb_field(seed: int, count: int = 256) -> list:
    out = []
    if not CEB_ORB_FIELD:
        return out
    start = seed % len(CEB_ORB_FIELD)
    for i in range(min(count, len(CEB_ORB_FIELD))):
        idx = (start + i) % len(CEB_ORB_FIELD)
        item = CEB_ORB_FIELD[idx]
        out.append(item)
    return out


def ceb_orb_mix(pin: dict, field: list) -> list:
    bias = pin.get("bias", {"x": 0.0, "y": 0.0, "sentiment": 0.0})
    freq = pin.get("frequency", 1.0)
    out = []
    for node in field:
        dx = bias["x"] - node["x"]
        dy = bias["y"] - node["y"]
        ds = bias["sentiment"] - node["s"]
        dist = math.sqrt(dx * dx + dy * dy + ds * ds)
        mix = max(0.0, 1.0 - dist / 1.7320508075688772)
        out.append({"node": node, "mix": mix * freq})
    return out


def ceb_orb_gate(posts: list, pin: dict, field: list) -> list:
    field_mix = ceb_orb_mix(pin, field)
    if not field_mix:
        return posts
    out = []
    for post in posts:
        rgb = post.get("rgb", (0, 0, 0))
        px = ((rgb[0] - rgb[2]) / 255.0)
        py = ((rgb[1] - 128.0) / 128.0)
        ps = float(post.get("sentiment", 0.0))
        score = 0.0
        for node in field_mix[:128]:
            dx = px - node["node"]["x"]
            dy = py - node["node"]["y"]
            ds = ps - node["node"]["s"]
            dist = math.sqrt(dx * dx + dy * dy + ds * ds)
            score += max(0.0, 1.0 - dist / 1.7320508075688772) * node["mix"]
        if score < 0.1:
            continue
        out.append({"post": post, "score": score})
    return out



def ceb_bias_field(seed: int, count: int = 256) -> list:
    out = []
    if not CEB_BIAS_FIELD:
        return out
    start = seed % len(CEB_BIAS_FIELD)
    for i in range(min(count, len(CEB_BIAS_FIELD))):
        idx = (start + i) % len(CEB_BIAS_FIELD)
        out.append(CEB_BIAS_FIELD[idx])
    return out


def ceb_bias_field_score(pin: dict, field: list) -> float:
    bias = pin.get("bias", {"x": 0.0, "y": 0.0, "sentiment": 0.0})
    if not field:
        return 0.0
    total = 0.0
    for node in field[:128]:
        dx = bias["x"] - node["x"]
        dy = bias["y"] - node["y"]
        dist = math.sqrt(dx * dx + dy * dy)
        total += max(0.0, 1.0 - dist / 1.4142135623730951) * node["w"]
    return total / max(1.0, min(128.0, float(len(field))))


def ceb_bias_field_gate(posts: list, pin: dict, field: list) -> list:
    score = ceb_bias_field_score(pin, field)
    if score <= 0.05:
        return []
    out = []
    for post in posts:
        rgb = post.get("rgb", (0, 0, 0))
        px = ((rgb[0] - rgb[2]) / 255.0)
        py = ((rgb[1] - 128.0) / 128.0)
        keep = (abs(px - pin["bias"]["x"]) + abs(py - pin["bias"]["y"])) < 1.2
        if keep:
            out.append(post)
    return out



def ceb_orb_tree(seed: int, count: int = 256) -> list:
    out = []
    if not CEB_ORB_TREE:
        return out
    start = seed % len(CEB_ORB_TREE)
    for i in range(min(count, len(CEB_ORB_TREE))):
        idx = (start + i) % len(CEB_ORB_TREE)
        out.append(CEB_ORB_TREE[idx])
    return out


def ceb_orb_tree_mix(pin: dict, tree: list) -> list:
    bias = pin.get("bias", {"x": 0.0, "y": 0.0, "sentiment": 0.0})
    freq = pin.get("frequency", 1.0)
    out = []
    for node in tree:
        dx = bias["x"] - node["x"]
        dy = bias["y"] - node["y"]
        ds = bias["sentiment"] - node["s"]
        dist = math.sqrt(dx * dx + dy * dy + ds * ds)
        mix = max(0.0, 1.0 - dist / 1.7320508075688772)
        out.append({"node": node, "mix": mix * freq * (0.6 + 0.4 * node["w"])})
    return out


def ceb_orb_tree_gate(posts: list, pin: dict, tree: list) -> list:
    field = ceb_orb_tree_mix(pin, tree)
    if not field:
        return posts
    out = []
    for post in posts:
        rgb = post.get("rgb", (0, 0, 0))
        px = ((rgb[0] - rgb[2]) / 255.0)
        py = ((rgb[1] - 128.0) / 128.0)
        ps = float(post.get("sentiment", 0.0))
        score = 0.0
        for node in field[:160]:
            dx = px - node["node"]["x"]
            dy = py - node["node"]["y"]
            ds = ps - node["node"]["s"]
            dist = math.sqrt(dx * dx + dy * dy + ds * ds)
            score += max(0.0, 1.0 - dist / 1.7320508075688772) * node["mix"]
        if score < 0.15:
            continue
        out.append({"post": post, "score": score})
    return out

